  const [timerPopup, setTimerPopup] = useState(false);

  setTimeout(()=>{
    setTimerPopup(true)
  }, 3000)
  return (
    <Popup trigger={timerPopup} setTrigger={setTimerPopup}/>
  )
}

export default Main
